import Link from 'next/link'

const Header = () => {
    return (
        <nav class="navbar level is-fixed-top is-white">
            <div class="navbar-brand level-item has-text-centered">
                <Link href="/">
                    <img src="/pokemon-logo.png" alt="pokemon logo" width="160"/>
                </Link>
            </div>
        </nav>
    )
}

export default Header
